import {Container, Row, Col} from 'react-bootstrap'
import styled from 'styled-components'

const Footer = () => {
    return (
        <footer>
            <Container>
                <Row>
                    <Col className="text-center py-3">
                        <p> Copyright &copy; Pirate Database</p>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
}
const footer=styled.footer`
    color:green;
    `;

export default Footer
